INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES ("アヤネ", 24001, 2, 24, "2020/07/31 12:00:00", 102301, "やったね、ぷうきち！\nこれならお兄ちゃんたちの\nお手本になれたよね！", 0.0, 2, 401, 10046, "2030/12/17 14:59:59", 0.0, 0.0);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES ("アヤネ", 24002, 2, 24, "2020/07/31 12:00:00", 102301, "私たちの勝ちだね！\nぷうきちと一緒なら\nどんなボールでも\nホームランを打ってみせるよ！", 0.0, 1, 402, 10046, "2030/12/17 14:59:59", 0.0, 2.21);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES ("アヤネ", 24003, 2, 24, "2020/07/31 12:00:00", 102301, "やったやったぁ！\nお兄ちゃん、見ててくれた？\n私、すっごくがんばったよ！", 0.0, 2, 403, 10046, "2030/12/17 14:59:59", 0.0, 0.0);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES ("アサヒ", 24004, 1, 24, "2020/07/31 12:00:00", 192201, "特訓の成果が出たみたいだ！\nもっと練習を重ねて\nこの調子で上達していこう！", 0.0, 2, 701, 10046, "2030/12/17 14:59:59", 0.0, 1.99);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES ("アサヒ", 24005, 2, 24, "2020/07/31 12:00:00", 192201, "よし、いい感じだ！\nキャプテンとしての仕事は\nきっちり果たせそうだよ", 0.0, 1, 702, 10046, "2030/12/17 14:59:59", 0.0, 2.21);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES ("アサヒ", 24006, 1, 24, "2020/07/31 12:00:00", 192201, "試合に向けて\nいい感覚を掴めた気がするよ！\nこのまま一気に全国大会だ！", 0.0, 2, 703, 10046, "2030/12/17 14:59:59", 0.0, 3.33);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES ("部員３", 24007, 2, 24, "2020/07/31 12:00:00", 192301, "このくらい余裕だ\nオレたちは全国大会を\n目指してるんだからな", 0.0, 2, 801, 10046, "2030/12/17 14:59:59", 0.0, 0.0);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES ("部員３", 24008, 2, 24, "2020/07/31 12:00:00", 192301, "オレだって\nビーチベースボール選手だ\nどんな球だろうが\n全部スタンドまで飛ばしてやる", 0.0, 1, 802, 10046, "2030/12/17 14:59:59", 0.0, 2.68);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES ("部員３", 24009, 2, 24, "2020/07/31 12:00:00", 192301, "いい感じだ\nこれなら試合でも活躍できそうだ\n大暴れしてやる！", 0.0, 2, 803, 10046, "2030/12/17 14:59:59", 0.0, 0.0);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES ("", 24010, 1, 24, "2020/07/31 12:00:00", 192501, "やった！", 0.0, 1, 501, 10046, "2030/12/17 14:59:59", 0.0, 0.0);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES ("", 24011, 1, 24, "2020/07/31 12:00:00", 192501, "勝ったよ！", 0.0, 1, 502, 10046, "2030/12/17 14:59:59", 0.0, 0.0);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES ("", 24012, 1, 24, "2020/07/31 12:00:00", 192501, "いい調子！", 0.0, 1, 503, 10046, "2030/12/17 14:59:59", 0.0, 0.0);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES ("ミサト", 24013, 2, 24, "2020/07/31 12:00:00", 113501, "あら～…もしかして\n勝っちゃったのかしら？\nみんなの練習を見ていたから\nかもしれないわね", 0.0, 6, 111, 10046, "2030/12/17 14:59:59", 0.0, 5.33);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES ("ミサト", 24014, 2, 24, "2020/07/31 12:00:00", 113501, "みんなの力になりたくて\n先生も頑張ってみました～！\nうまく投げられたみたいで\nよかったわ～！", 0.0, 1, 112, 10046, "2030/12/17 14:59:59", 0.0, 6.85);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES ("ミサト", 24015, 2, 24, "2020/07/31 12:00:00", 113501, "練習お疲れさま～！\n先生も協力できて\nとってもうれしいわ～♪\n次も頑張りましょうね～！", 0.0, 1, 113, 10046, "2030/12/17 14:59:59", 0.0, 3.0);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES ("ダイチ", 24016, 2, 24, "2020/07/31 12:00:00", 192401, "まだ練習が足りねえみてえだな\nこれっぽっちも本気で\n投げてねえっつーの\nもう一回やんぞ！", 0.0, 1, 611, 10046, "2030/12/17 14:59:59", 0.0, 6.11);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES ("ダイチ", 24017, 2, 24, "2020/07/31 12:00:00", 192401, "ふん、当然の結果だな\n俺の球は、誰にも打てねえよ！\nまたやりてえっつーなら\nとことん付き合ってやるぜ！", 0.0, 1, 612, 10046, "2030/12/17 14:59:59", 0.0, 6.75);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES ("ダイチ", 24018, 2, 24, "2020/07/31 12:00:00", 192401, "おっしゃあ！\nこの勢いで全国に行ってやるぜ！\n全員三振で仕留めてやる！", 0.0, 2, 613, 10046, "2030/12/17 14:59:59", 0.0, 0.0);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES ("ハツネ", 24019, 1, 24, "2020/07/31 12:00:00", 113401, "きらーん☆\nハツネちゃんの大勝利なのだ～！\nみんながもっと上達できるように\n私もまだまだ頑張るからね！", 0.0, 2, 211, 10046, "2030/12/17 14:59:59", 0.0, 4.52);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES ("ハツネ", 24020, 1, 24, "2020/07/31 12:00:00", 113401, "やったあ！　私の勝ちだね！\nチアリーダーもピッチャーも\nハツネちゃんに任せてよ！", 0.0, 2, 212, 10046, "2030/12/17 14:59:59", 0.0, 3.89);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES ("ハツネ", 24021, 2, 24, "2020/07/31 12:00:00", 113401, "よお～し、この調子でもっと\n頑張ろう…と思ったけど\n超能力を使ったから…\n眠くなってきちゃった…すやぁ…", 0.0, 1, 213, 10046, "2030/12/17 14:59:59", 0.0, 13.49);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES ("カヤ", 24022, 2, 24, "2020/07/31 12:00:00", 106501, "いい勝負だったぜ！\nたぎっちまって\nつい本気で投げちまったよ", 0.0, 1, 311, 10046, "2030/12/17 14:59:59", 0.0, 3.17);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES ("カヤ", 24023, 2, 24, "2020/07/31 12:00:00", 106501, "どうだ？\nオレ様のボールは熱かっただろ！\nま、でもおまえらの根性も\nなかなかのもんだったぜ", 0.0, 1, 312, 10046, "2030/12/17 14:59:59", 0.0, 4.42);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES ("カヤ", 24024, 1, 24, "2020/07/31 12:00:00", 106501, "なんだよ、そんなもんか？\nこっちはまだまだ投げたりねえ\nもっと勝負しようぜ！", 0.0, 6, 313, 10046, "2030/12/17 14:59:59", 0.0, 2.89);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES ("アヤネ", 24025, 3, 24, "2020/07/31 12:00:00", 102301, "あとちょっとだったのに～！\n次こそぷうきちと一緒に\n勝ってみせるからね！", 0.0, 4, 421, 10046, "2030/12/17 14:59:59", 0.0, 3.71);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES ("アサヒ", 24026, 1, 24, "2020/07/31 12:00:00", 192201, "いい勝負だったね！\nでも、やっぱり悔しいな…\nもっと練習して\n今度は絶対に俺が勝つから！", 0.0, 2, 721, 10046, "2030/12/17 14:59:59", 0.0, 5.1);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES ("部員３", 24027, 3, 24, "2020/07/31 12:00:00", 192301, "ちっ…あと一歩足りなかったか\n次こそは絶対に勝つから\nそのつもりでいろ", 0.0, 1, 821, 10046, "2030/12/17 14:59:59", 0.0, 4.34);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES ("", 24028, 1, 24, "2020/07/31 12:00:00", 192501, "いい勝負だったよ\nまたやろうね", 0.0, 1, 521, 10046, "2030/12/17 14:59:59", 0.0, 0.0);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES ("ミサト", 24029, 2, 24, "2020/07/31 12:00:00", 113501, "とってもよくできました～♪\n頑張ってくれて先生うれしいわ\nこれからも試合に向けて\n練習していきましょうね～", 0.0, 1, 101, 10046, "2030/12/17 14:59:59", -360.0, 5.62);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES ("ミサト", 24030, 2, 24, "2020/07/31 12:00:00", 113501, "頑張った成果ね～！\nこのまま練習を続ければ\nもっとすごい成績を残せそうよ\n期待してますからね～！", 0.0, 1, 102, 10046, "2030/12/17 14:59:59", -360.0, 9.58);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES ("ミサト", 24031, 2, 24, "2020/07/31 12:00:00", 113501, "いい子、いい子～♪\n頑張り屋さんのあなたを\nたっくさん褒めてあげますからね", 0.0, 2, 103, 10046, "2030/12/17 14:59:59", -360.0, 0.0);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES ("ミサト", 24032, 1, 24, "2020/07/31 12:00:00", 113501, "夢に向けて、一歩前進できたわね\nこの調子で、夢を叶えましょう\n目指せ、全国大会～！", 0.0, 2, 104, 10046, "2030/12/17 14:59:59", -360.0, 9.13);
INSERT INTO `v1_ecad5942cd1c62918de38109dc15b8b8e861fab5270269ced46f38b6925b9a44` VALUES ("ミサト", 24033, 2, 24, "2020/07/31 12:00:00", 113501, "絶好調ね～♪\nきっと試合でも大活躍\n間違いなしだわ\n楽しみにしていますからね～！", 0.0, 1, 105, 10046, "2030/12/17 14:59:59", -360.0, 8.27);
